import React from 'react';
import { View, Text, StyleSheet, FlatList} from 'react-native';
import CategoryCard from './CategoryCard';

const categories = [
    { id: '1', title: 'Exercise', tasks: '12 Tasks', image: 'data:image/jpeg;base64,' },
    { id: '2', title: 'Study', tasks: '12 Tasks', image: 'data:image/jpeg;base64,' },
    { id: '3', title: 'Code', tasks: '15 Tasks', image: 'data:image/jpeg;base64,' },
    { id: '4', title: 'Cook', tasks: '8 Tasks', image: 'data:image/jpeg;base64,' },
    { id: '5', title: 'Read', tasks: '5 Tasks', image: 'data:image/jpeg;base64,' },
    { id: '6', title: 'Meditate', tasks: '10 Tasks', image: 'data:image/jpeg;base64,' },
    { id: '7', title: 'Sleep', tasks: '7 Tasks', image: 'data:image/jpeg;base64,' },
    { id: '8', title: 'Shop', tasks: '4 Tasks', image: 'data:image/jpeg;base64,' },
];

const Categories = () => {
    return (
        <View>
            <Text style={styles.heading}>Categories</Text>
            <FlatList
                data={categories}
                renderItem={({ item }) => <CategoryCard category={item} />}
                keyExtractor={(item) => item.id}
                horizontal
                showsHorizontalScrollIndicator={false}
            />
        </View>
    );
};

const styles = StyleSheet.create({
    heading: {
        fontSize: 18,
        fontWeight: 'bold',
        marginBottom: 10,
    },
});

export default Categories;
